webpackJsonp([0xfca9231bd3d7],{1248:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-06-29-iphone/index.md absPath of file >>> MarkdownRemark",html:"<p>Yup, I got one. I was going to go mountain biking at lunch today, but instead I got suckered into going down to the local AT&#x26;T store and waiting for 7 hours to get one of these babies.</p>\n<p>They are cool.</p>\n<p>The screen is sweet. The interface is slick. I love to browse through my albums. It is almost like the old Juke boxes you could find in burger joints. For my next trick I need to find out how to import my contacts from my old phone.</p>\n<p>As for waiting.</p>\n<p>Today was quite productive. I, Dave Ray and David Wiley managed to brainstorm all kinds of ideas and we met with the Nepal group for a while. The meeting turned out to be really awesome. One of the guys is interested in and currently working on a GeoStories like idea that Marion was looking into about a year ago. More on that another time (like after it is built).</p>",frontmatter:{title:"iPhone",date:"June 29, 2007",imageUrl:null,image:null}}},pathContext:{path:"/iphone"}}}});
